import React, { Component } from 'react';
//import { Link } from 'react-router-dom';


class Home extends Component {
  render() {
    return (
    <div className="App">
      <h1>Project Home</h1>
      {}

        <button variant="raised">
            My List
        </button>

    </div>
    );
  }
}
export default Home;
